import React, { Component } from "react";
import "./App.css";
import Header from "./component/Header/Header";
import QuanLyNguoiDung from "./component/QuanLyNguoiDung/QuanLyNguoiDung";
import QuanLyGioHang from "./component/QuanLyGioHang/QuanLyGioHang";
import TrangChu from "./component/TrangChu/TrangChu";
import { Route } from "react-router-dom";
export default class App extends Component {
  render() {
    let route = [
      {
        path: "/",
        exact: true,
        component: <TrangChu />,
      },
      {
        path: "/quanlynguoidung",
        exact: false,
        component: <QuanLyNguoiDung />,
      },
      {
        path: "/quanlygiohang",
        exact: false,
        component: <QuanLyGioHang />,
      },
    ];

    return (
      <>
        <div className="container">
          <div className="logo">Logo</div>
          <div className="menu"></div>
        </div>
        <div className="main">
          <div className="left">
            <Header />
          </div>
          <div className="right">
            {route.map((route, index) => {
              return (
                <Route key={index} path={route.path} exact={route.exact}>
                  {route.component}
                </Route>
              );
            })}
          </div>
        </div>
      </>
    );
  }
}
